const CreateAccountScreen = ({ navigation }) => {
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [confirmPassword, setConfirmPassword] = useState('');
    const [error, setError] = useState('');

    const handleCreateAccount = () => {
        if (!email || !password || !confirmPassword) {
            setError('Please fill in all fields.');
            return;
        }
        if (!validateEmail(email)) {
            setError('Please enter a valid email address.');
            return;
        }
        if (password !== confirmPassword) {
            setError('Passwords do not match.');
            return;
        }
        console.log('Account created:', email);
        setError('');
        navigation.navigate('Login'); // Redirige vers l'écran de connexion
    };

    const validateEmail = (email) => {
        const regex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
        return regex.test(email);
    };

    return (
        <KeyboardAvoidingView
            behavior={Platform.OS === 'ios' ? 'padding' : 'height'}
            style={styles.container}
        >
            <View style={styles.titleContainer}>
                <View style={styles.titleWrapper}>
                    <Text style={styles.title}>Create an Account</Text>
                    <Ionicons name="log-in-outline" size={24} color={COLORS.text} style={styles.titleIcon} />
                </View>
                <Text style={styles.slogan}>Join us and make every meal a positive action</Text>
            </View>

            <SvgXml xml={svgIcon} width={350} height={350} />

            {/* Champ Email */}
            <View style={styles.inputContainer}>
                <Ionicons name="mail-outline" size={24} color={COLORS.placeholder} style={styles.icon} />
                <TextInput
                    style={styles.input}
                    placeholder="Email"
                    placeholderTextColor={COLORS.placeholder}
                    value={email}
                    onChangeText={setEmail}
                    keyboardType="email-address"
                    autoCapitalize="none"
                />
            </View>

            {/* Champ Mot de passe */}
            <View style={styles.inputContainer}>
                <Ionicons name="lock-closed-outline" size={24} color={COLORS.placeholder} style={styles.icon} />
                <TextInput
                    style={styles.input}
                    placeholder="Password"
                    placeholderTextColor={COLORS.placeholder}
                    value={password}
                    onChangeText={setPassword}
                    secureTextEntry
                />
            </View>

            {/* Champ Confirmation du mot de passe */}
            <View style={styles.inputContainer}>
                <Ionicons name="lock-closed-outline" size={24} color={COLORS.placeholder} style={styles.icon} />
                <TextInput
                    style={styles.input}
                    placeholder="Confirm Password"
                    placeholderTextColor={COLORS.placeholder}
                    value={confirmPassword}
                    onChangeText={setConfirmPassword}
                    secureTextEntry
                />
            </View>

            {/* Affichage des erreurs */}
            {error ? <Text style={styles.errorText}>{error}</Text> : null}

            {/* Bouton de création de compte */}
            <TouchableOpacity style={styles.button} onPress={handleCreateAccount}>
                <Text style={styles.buttonText}>Sign Up</Text>
            </TouchableOpacity>

            {/* Lien vers l'écran de connexion */}
            <TouchableOpacity onPress={() => navigation.navigate('Login')}>
                <Text style={styles.linkText}>Already have an account? Log in</Text>
            </TouchableOpacity>
        </KeyboardAvoidingView>
    );
};

